import React from 'react';
import styled from 'styled-components';
import HomePage from './HomePage';
import LoginPage from './LoginPage';
import FormPage from './FormPage';

const Container = styled.div`
  display: flex;
  height: 100vh;
  position: relative;
  background-color: #f0f0f0; /* Cambia el color de fondo según tu preferencia */
  justify-content: center;
  align-items: center;
`;

const App = () => {
  const [currentPage, setCurrentPage] = React.useState('home');

  const handleNavigate = (page) => {
    setCurrentPage(page);
  };

  return (
    <Container>
      {currentPage === 'home' && <HomePage navigate={handleNavigate} />}
      {currentPage === 'login' && <LoginPage navigate={handleNavigate} />}
      {currentPage === 'registro_emp' && <FormPage navigate={handleNavigate} />}
    </Container>
  );
};

export default App;
